import React, { Component } from 'react';
export default class About extends Component {
  render() {
    return (
      <section id="about">
        <div className="row">
          <div className="three columns">
            <img className="profile-pic" src="images/profilepic.jpg" alt=""/>
          </div>
          <div className="nine columns main-col">
            <h2>About Me</h2>
            <p>Hi everyone, I'm Bhavesh and I'm a sophomore at Macaulay Honors College in NYC. I have a huge passion for coding,  
            </p>
          </div> {/* end .main-col */}
        </div>
      </section>
    );
  }
};
